import React from 'react';

import './checkout.styles.scss';

class CheckoutPage extends React.Component {
    constructor(){
        super();

        this.state = {}
    }

    render(){
        return (
            <div className="checkout-page">
                <div className="container">
                    <div className="row">
                        <div className="checkout"></div>
                    </div>
                </div>
            </div>
        )
    }
}

export default CheckoutPage;
